package Java;

public class Array {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[][] arr= { {10,20,30,40,50}, {05,15,25,35,45} };
		for (int i=0; i<5; i++) {
			for(int j =0; j<5; j++) {
			System.out.println(arr[i][j]+" ");
		}
		System.out.println();
	}

}
}
